.game-window {
  max-width: 90%;
  max-height: 700px;
  margin: 0 auto;
  display: grid;
  grid-template-columns: repeat(17, 1fr);
  grid-template-rows: repeat(10, 1fr);
}
.game-window #message-board {
  grid-column: 5/span 9;
  grid-row: 1/span 1;
  justify-self: stretch;
  background-color: lightgoldenrodyellow;
}
.game-window .player-board .runeboard {
  background-color: #2b1f12;
}
.game-window .player-board .runeboard img {
  max-height: 50px;
}
.game-window #ulf-board {
  background-color: lightblue;
  grid-column: 1/span 3;
  grid-row: 4/span 4;
}
.game-window #sigrid-board {
  background-color: lightblue;
  grid-column: 15/span 3;
  grid-row: 4/span 4;
}
.game-window #pot {
  background-color: coral;
  grid-column: 6/span 7;
  grid-row: 3/span 6;
}
.game-window #pot .piece-slot {
  background-color: red;
}
.game-window #pot {
  grid-column: 5/span 7;
  grid-row: 3/span 6;
}

@media (max-width: 1000px) {
  body {
    background-color: red;
  }
}
